import React from "react";

function AboutSection() {
  return (
    <section id="about" className="section about">
      <h2>About Me</h2>
      <p>
        I am an experienced Software Developer with expertise in React, Python,
        Django, and AWS. I thrive in collaborative environments and deliver
        impactful, innovative solutions.
      </p>
    </section>
  );
}

export default AboutSection;
